import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const PWAGuideContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: rgba(0, 0, 0, 0.9);
  display: ${props => props.show ? 'flex' : 'none'};
  align-items: center;
  justify-content: center;
  z-index: 9999;
  padding: 20px;
`;

const GuideContent = styled.div`
  background: white;
  border-radius: 20px;
  padding: 30px;
  max-width: 350px;
  width: 100%;
  text-align: center;
`;

const Title = styled.h2`
  margin-bottom: 20px;
  color: var(--text-color);
  font-size: 24px;
`;

const Step = styled.div`
  margin-bottom: 20px;
  text-align: left;
`;

const StepNumber = styled.div`
  display: inline-block;
  width: 24px;
  height: 24px;
  background: linear-gradient(135deg, #ff6b8a, #4ecdc4);
  color: white;
  border-radius: 50%;
  text-align: center;
  line-height: 24px;
  font-weight: 600;
  font-size: 12px;
  margin-right: 10px;
`;

const StepText = styled.span`
  font-size: 14px;
  line-height: 1.4;
`;

const Icon = styled.div`
  font-size: 20px;
  margin: 0 5px;
  display: inline-block;
`;

const CloseButton = styled.button`
  background: linear-gradient(135deg, #ff6b8a, #4ecdc4);
  color: white;
  border: none;
  padding: 12px 24px;
  border-radius: 12px;
  font-weight: 600;
  cursor: pointer;
  margin-top: 20px;
`;

const DismissButton = styled.button`
  background: transparent;
  color: var(--text-light);
  border: none;
  padding: 8px;
  font-size: 12px;
  cursor: pointer;
  margin-top: 10px;
`;

export default function PWAGuide() {
