    if (isIOS && !isInStandaloneMode && !hasSeenGuide) {
      // Attendre un peu avant d'afficher le guide
      setTimeout(() => setShowGuide(true), 2000);
    }
  }, []);

  const handleClose = () => {
    setShowGuide(false);
    localStorage.setItem('pwa_guide_seen', 'true');
  };

